import React, {Component} from "react";
import {MDBContainer} from "mdbreact";
import NavbarPage from "./Components/navbar";
import "./index.css"




class App extends Component{
  render(){
    return(
      <MDBContainer className="header-container">
        <NavbarPage />
      </MDBContainer>
        
      
    );
  }
}
export default App;
